import React, { useState } from "react";
import './Styles/App.css'

function App() {
  const [counter, setCounter] = useState(0);
  return (
    <div className="App">
      <div className="block" onClick={(e) => setCounter(counter++)}>

      </div>
    </div>
  );
}

export default App;
